import React from 'react'
import Navbar from '../components/navbar';
import WazuhAgents from '../components/wazuh_agents';
import './Home.css';

function Home() {
  return (
    <div>
        <Navbar />
        <div className='container-fluid'>
        <WazuhAgents/>
        </div>
    </div>
  )
}

export default Home
